sys_variable_value.value:
(function execute(inputs, outputs) {
  let updateCount = 0;
  let errorCount = 0;
  const failedPackages = [];
  let orgRecord = new GlideRecord('x_g_dis_atat_organization');

  const findDisaOrg = (name) => {
    var disaOrgOptional = new global.GlideQuery('x_g_dis_atat_disa_organization')
    .where('full_name', name)
    .selectOne();
    if (!disaOrgOptional.isPresent()) {
      throw "Could not find a DISA Organization with name " + name;
    }
    else {
      return disaOrgOptional.get();
    }
  }
  while (inputs.disa_packages.next()) {
    try {
      orgRecord.get(inputs.disa_packages.organization.sys_id);   
      var orgName = orgRecord.getDisplayValue("disa_organization");
      let disaOrg = findDisaOrg(orgName);
      orgRecord.disa_organization_reference = disaOrg.sys_id;      
      orgRecord.update();
      updateCount++;
    } catch (error) {
      gs.error("An error occurred while attempting to migrate the DISA Organization " + orgName);
      failedPackages.push(inputs.disa_packages.sys_id);
      errorCount++;
    }

  }

  //set outputs
  outputs.update_count = updateCount;
  outputs.error_count = errorCount;
  outputs.failed_packages = failedPackages;
})(inputs, outputs);

